var title_f43_13_44247="Gnathostomiasis life cycle";
var content_f43_13_44247=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F59378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F59378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 542px\">",
"   <div class=\"ttl\">",
"    Gnathostomiasis life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 522px; height: 485px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the natural definitive host (pigs, cats, dogs, wild animals) the adult worms reside in a tumor which they induce in the gastric wall. They deposit eggs that are unembryonated when passed in the feces",
"    <strong>",
"     (1)",
"    </strong>",
"    . Eggs become embryonated in water, and eggs release first-stage larvae",
"    <strong>",
"     (2)",
"    </strong>",
"    . If ingested by a small crustacean (",
"    <em>",
"     Cyclops",
"    </em>",
"    , first intermediate host), the first-stage larvae develop into second-stage larvae",
"    <strong>",
"     (3)",
"    </strong>",
"    . Following ingestion of the",
"    <em>",
"     Cyclops",
"    </em>",
"    by a fish, frog, or snake (second intermediate host), the second-stage larvae migrate into the flesh and develop into third-stage larvae",
"    <strong>",
"     (4)",
"    </strong>",
"    . When the second intermediate host is ingested by a definitive host, the third-stage larvae develop into adult parasites in the stomach wall",
"    <strong>",
"     (5)",
"    </strong>",
"    . Alternatively, the second intermediate host may be ingested by the paratenic host (animals such as birds, snakes, and frogs) in which the third-stage larvae do not develop further but remain infective to the next predator",
"    <strong>",
"     (6)",
"    </strong>",
"    . Humans become infected by eating undercooked fish or poultry containing third-stage larvae, or reportedly by drinking water containing infective second-stage larvae in",
"    <em>",
"     Cyclops",
"    </em>",
"    <strong>",
"     (7)",
"    </strong>",
"    .",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Gnathostomiasis. Available at:",
"     <a href=\"file://dpd.cdc.gov/dpdx/html/Gnathostomiasis.htm\" target=\"_blank\">",
"      file://dpd.cdc.gov/dpdx/html/Gnathostomiasis.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
