"     Reproduced with permission from: Goodheart, HP. Goodheart's Photoguide of Common Skin Disorders, 2nd ed. Lippincott Williams &amp; Wilkins 2003. Copyright &copy; 2003 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
