var title_f43_13_44254="Toe stand video";
var content_f43_13_44254=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1070px;\">",
"  <div class=\"videoplayer\" h264=\"./images/PC/73796/Toe_stand_video.mp4?title=Toe+stand+video\" style=\"width:480px;height:336px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Strength exercise video: Toe stand",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 369px; height: 297px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This exercise will help make walking easier by strengthening your calves and ankles. For an added challenge, you can modify the exercise to improve your balance.",
"    <br>",
"     <ol>",
"      <li>",
"       Stand behind a sturdy chair, feet shoulder-width apart, holding on for balance. Breathe in slowly.",
"      </li>",
"      <li>",
"       Breathe out and slowly stand on tiptoes, as high as possible.",
"      </li>",
"      <li>",
"       Hold position for one second.",
"      </li>",
"      <li>",
"       Breathe in as you slowly lower heels to the floor.",
"      </li>",
"      <li>",
"       Repeat 10 to 15 times.",
"      </li>",
"      <li>",
"       Rest; then repeat 10 to 15 more times.",
"      </li>",
"     </ol>",
"     As you progress, try doing the exercise standing on one leg at a time for a total of 10 to 15 times on each leg.",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      Reproduced from: Go4Life. National Institute on Aging at the National Institutes of Health. Available at: file://go4life.niapublications.org (Accessed December 2, 2011).",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
